import { useEffect } from "react";
import './App.css';

function App() {

  useEffect(async () => {
    const response = await fetch('https://rickandmortyapi.com/api/character')
    const data = await response.json()
    console.log(data);
  }, []);

  return (
    <h1>Hello World</h1>
  );
}

export default App;
